            font-weight: 500;
        }

        .controls select:focus {
            outline: none;
            border-color: #4a90e2;

            position: relative;
            height: 500px;

        @media (max-width: 768px) {
            .container {
                padding: 20px;
            }

                font-size: 22px;
            }

            .controls {

            }

                width: 100%;
            }
        }
    </style>
</head>

        // Parse CSV data
        function parseCSV(csv) {
            const lines = csv.trim().split('\n');
            const headers = lines[0].split(',');
            const data = [];

            for (let i = 1; i < lines.length; i++) {
                const values = lines[i].split(',');
                const row = {};
                headers.forEach((header, index) => {
                    row[header] = values[index];
                });
                data.push(row);
            }

            return data;
        }

        const dataset = parseCSV(rawData);

        // Extract unique TOCs and filter to only those with known names
        const tocs = [...new Set(dataset.map(row => row.toc))]
            .filter(toc => tocNames[toc])  // Only include TOCs with names
            .sort((a, b) => {
                const nameA = tocNames[a];
                const nameB = tocNames[b];
                return nameA.localeCompare(nameB);
            });

        // Populate dropdown
        const tocSelect = document.getElementById('toc-select');
        tocs.forEach(toc => {
            const option = document.createElement('option');
            option.value = toc;
            option.textContent = tocNames[toc];
            tocSelect.appendChild(option);
        });

        // Aggregate data by date and optionally by TOC
        function aggregateData(selectedToc = 'all') {
            const dateMap = new Map();

            dataset.forEach(row => {
                if (selectedToc !== 'all' && row.toc !== selectedToc) {
                    return;
                }

                const date = row.date;

                if (!dateMap.has(date)) {
                    dateMap.set(date, {
                        count: 0,
                        sum0_5: 0,
                        sum5_15: 0,
                        sum15_30: 0,
                        sum30_plus: 0
                    });
                }

                const entry = dateMap.get(date);
                entry.count += 1;
                entry.sum0_5 += parseFloat(row.pct_0_5_mins) || 0;
                entry.sum5_15 += parseFloat(row.pct_5_15_mins) || 0;
                entry.sum15_30 += parseFloat(row.pct_15_30_mins) || 0;
                entry.sum30_plus += parseFloat(row.pct_30_plus_mins) || 0;
            });

            // Calculate averages
            const dates = Array.from(dateMap.keys()).sort();
            const result = {
                dates: dates,
                pct_0_5: [],
                pct_5_15: [],
                pct_15_30: [],
                pct_30_plus: []
            };

            dates.forEach(date => {
                const entry = dateMap.get(date);
                if (entry.count > 0) {
                    result.pct_0_5.push(entry.sum0_5 / entry.count);
                    result.pct_5_15.push(entry.sum5_15 / entry.count);
                    result.pct_15_30.push(entry.sum15_30 / entry.count);
                    result.pct_30_plus.push(entry.sum30_plus / entry.count);
                } else {
                    result.pct_0_5.push(0);
                    result.pct_5_15.push(0);
                    result.pct_15_30.push(0);
                    result.pct_30_plus.push(0);
                }
            });

            return result;
        }

        // Chart configuration
        const isDarkMode = window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches;

        const chartConfig = {
            type: 'line',
            data: {
                labels: [],
                datasets: [
                    {
                        label: '0-5 mins',
                        data: [],
                        backgroundColor: 'rgba(52, 211, 153, 0.7)',
                        borderColor: 'rgba(52, 211, 153, 1)',
                        borderWidth: 1,
                        fill: true,
                        tension: 0.4
                    },
                    {
                        label: '5-15 mins',
                        data: [],
                        backgroundColor: 'rgba(251, 146, 60, 0.7)',
                        borderColor: 'rgba(251, 146, 60, 1)',
                        borderWidth: 1,
                        fill: true,
                        tension: 0.4
                    },
                    {
                        label: '15-30 mins',
                        data: [],
                        backgroundColor: 'rgba(248, 113, 113, 0.7)',
                        borderColor: 'rgba(248, 113, 113, 1)',
                        borderWidth: 1,
                        fill: true,
                        tension: 0.4
                    },
                    {
                        label: '30+ mins',
                        data: [],
                        backgroundColor: 'rgba(167, 139, 250, 0.7)',
                        borderColor: 'rgba(167, 139, 250, 1)',
                        borderWidth: 1,
                        fill: true,
                        tension: 0.4
                    }
                ]
            },
            options: {
                responsive: true,
                maintainAspectRatio: false,
                interaction: {
                    mode: 'index',
                    intersect: false
                },
                plugins: {
                    legend: {
                        position: 'bottom',
                        labels: {
                            color: isDarkMode ? '#e0e0e0' : '#333',
                            usePointStyle: true,
                            padding: 15
                        }
                    },
                    tooltip: {
                        mode: 'index',
                        intersect: false,
                        callbacks: {
                            label: function(context) {
                                return context.dataset.label + ': ' + context.parsed.y.toFixed(1) + '%';
                            }
                        }
                    }
                },
                scales: {
                    x: {
                        stacked: true,
                        grid: {
                            color: isDarkMode ? 'rgba(255, 255, 255, 0.1)' : 'rgba(0, 0, 0, 0.1)'
                        },
                        ticks: {
                            color: isDarkMode ? '#e0e0e0' : '#666',
                            maxRotation: 45,
                            minRotation: 45
                        }
                    },
                    y: {
                        stacked: true,
                        min: 0,
                        max: 100,
                        grid: {
                            color: isDarkMode ? 'rgba(255, 255, 255, 0.1)' : 'rgba(0, 0, 0, 0.1)'
                        },
                        ticks: {
                            color: isDarkMode ? '#e0e0e0' : '#666',
                            callback: function(value) {
                                return value + '%';
                            }
                        },
                        title: {
                            display: true,
                            text: 'Percentage of Services (%)',
                            color: isDarkMode ? '#e0e0e0' : '#666'
                        }
                    }
                }
            }
        };

        // Initialize chart
        const ctx = document.getElementById('delayChart').getContext('2d');
        const chart = new Chart(ctx, chartConfig);

        // Update chart with initial data
        function updateChart(selectedToc = 'all') {
            const data = aggregateData(selectedToc);

            chart.data.labels = data.dates;
            chart.data.datasets[0].data = data.pct_0_5;
            chart.data.datasets[1].data = data.pct_5_15;
            chart.data.datasets[2].data = data.pct_15_30;
            chart.data.datasets[3].data = data.pct_30_plus;

            chart.update();
        }

        // Event listener for dropdown
        tocSelect.addEventListener('change', (e) => {
            updateChart(e.target.value);
        });

        // Load initial data
        updateChart('all');

        // Handle dark mode changes
        window.matchMedia('(prefers-color-scheme: dark)').addEventListener('change', (e) => {
            const isDark = e.matches;
            const textColor = isDark ? '#e0e0e0' : '#666';
            const gridColor = isDark ? 'rgba(255, 255, 255, 0.1)' : 'rgba(0, 0, 0, 0.1)';

            chart.options.plugins.legend.labels.color = textColor;
            chart.options.scales.x.grid.color = gridColor;
            chart.options.scales.x.ticks.color = textColor;
            chart.options.scales.y.grid.color = gridColor;
            chart.options.scales.y.ticks.color = textColor;
            chart.options.scales.y.title.color = textColor;

            chart.update();
        });
    </script>
